/* Effects */
.fa-bars {
    font-size: 1.5em;
    transition: color 1s;
    color: rgba(0, 0, 0, 0.5);
}

.fa-bars:hover {
    cursor: pointer;
    color: rgba(0, 0, 0, 0.9);
}

.itemClick {
    transition: 1s background-color;
}

.itemClick:hover {
    background-color: grey;
    cursor: pointer;
}

li > a {
    text-decoration: none;
    color: rgb(126, 126, 126);
    transition: 0.6s color;
    font-weight: bold;
}

li > a:hover {
    text-decoration: none;
    color: rgb(184, 160, 180);
}
